            <Box
              sx={{
                background: "#F5F5F5",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                borderRadius: "50%",
                width: "28px",
                height: "28px",
              }}
            >
              <CircleIcon
                sx={{ color: THEME.GREEN_PRIMARY, fontSize: "22px" }}
              />
            </Box>
          }
        />
        <Box
          sx={{
            display: "flex",
            width: "100%",
            justifyContent: "space-between",
            alignItems: "flex-end",
          }}
        >
          <Box sx={{ display: "flex", alignItems: "flex-start",}}>
            <img src={image} width="53px" height={"42px"} />
            <Box sx={{ ml: "10px" }}>
              <Typography sx={{ fontSize: "12px", fontWeight: 500 }}>
                {title}
                {/* {console.log(name)} */}
                {/* Ayam Bakar */}
